import "./Piece.css";

class Piece extends React.Component {
	constructor(props) {
		super(props);
		this.number = props.number;
		this.position = props.position;
		this.state = {}
		Piece.instances.push(this);
	}

	checkRules(e) {
		let target = e.target;
		console.log(target);
	}

	render() {
		let theId = "_" + this.number;
		return (
			<div>
				<div className="piece" onClick={() => this.checkRules } draggable="true" data-number={this.number} id={theId}>
				{this.number}
				</div>
			</div>
			);
	}
}

